●約1.2倍の高火力で炊き続ける「豪熱沸とう」＆ハイパワー495W(最大電力)<br>炊飯時の中パッパ工程で一気に火力を引き上げ、沸とう中も高火力を維持し(平均電力約290W)、激しい対流を起こします。炊きムラを抑え、芯までふっくらしたごはんが炊き上がります。<br>※白米メニュー炊飯時：中パッパから沸とう維持工程の平均電力約290W。最大電力は495Wです。<br>●ふたヒーターつきでふっくらおいしい「全面加熱」<br>上ふた、側面、釜底のヒーターが釜全体を包み込み、芯までふっくら炊き上げます。<br>蒸らしの時も釜底と上ふたのヒーターが、ごはんのべちゃつきの原因となるつゆを抑え、しゃっきり炊き上げます。<br>●熱が側面まで伝わりやすい広く浅めの形状「黒厚釜(2.5mm)」<br>●ふきこぼれを抑える「大型蒸気口」<br>●栄養価の高い雑穀米や玄米、金芽米が炊ける「健康米メニュー」<br>※金芽米は東洋ライス株式会社の登録商標です。<br>ミネラルや食物繊維がたっぷり入った雑穀米や玄米が炊けます。<br>また、胚芽の基底部と亜糊粉層(あこふんそう)をバランスよく残すことで高い栄養価とおいしさを実現した金芽米が炊ける専用メニューがあります。<br>●発酵から焼き上げまで手作りパンが楽しめる「パン(発酵・焼き)」メニュー<br>発酵と焼きが選択できるメニューです。<br>丸パンやごはん入り丸パン、メロンパン、フォカッチャなどが作れます。<br>●はずして洗えるディンプルアルミ内ぶた<br><br>【その他搭載機能】<br>・あったか再加熱：保温中に再加熱キーを押すとあったかいごはんが食べられます。<br>・お知らせメロディ：タイマーセット時、炊飯完了時にメロディーでお知らせします。<br>・時計式2メモリータイマー：2種類のタイマーセットができます。<br>・親切目盛(0.5カップごと)：内釜に水位線がついています。<br>・洗える内ぶた：汚れやすい内ぶたが、はずして洗えるので本体に汚れがつきにくくいつも清潔に保てます。<br><br>■炊飯時消費電力：495W<br>■1回あたりの炊飯時消費電力量：93.7Wh<br>■1時間あたりの保温時消費電力量：9.37Wh<br>■省エネ基準達成率：102％<br>■年間消費電力量：37.2kWh/年<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：象印マホービン<br>シリーズ名：極め炊き<br>サイズ：23.5×32.5×19.5cm<br>炊飯容量(白米)：0.09～0.54L(0.5合～3合)<br>本体質量：約2.7kg<br><br>購入単位：1台<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4974305213334 nl-bb05-tm NL-BB05-TM NL-BB05 nl-bb05 P54073 9N1236 p54073 9n1236 象印 マイコン炊飯ジャー 極め炊き 3合 カッパーブラウン 象印マホービン ぞうじるしまほーびん ゾウジルシ ぞうじるし ゾウジルシマホービン マイコン炊飯ジャー マイコン まいこん 炊飯ジャー炊飯器 すいはんき ご飯 ごはん 家電 かでん 電化製品 キッチン家電 キッチン用品 きわめだき 極めだき きわめ炊き</font></td></tr></table><style type="text/css">
