虫コナーズ キッチン用 30日 6個入<br>ブランド：虫コナーズ<br>販売・製造元：大日本除虫菊<br><br>置くだけでにおわない天然ハーブ成分がひろがり、キッチンのイヤなはう虫を寄せ付けない虫よけ芳香剤です。<br>食器などへのニオイ移りがありません。<br>薄型カードタイプで場所をとりません。<br>キッチンのイヤなはう虫が嫌がる成分と消臭成分配合で、快適な収納空間をつくります。<br> <br><br><br>使用方法<br>●袋から取り出し、キッチンのイヤな「はう虫」が潜んでいそうな引出しの隅等に置いてください。<br>*容器は開けないでください。<br>●使用開始時に容器に開始年月日を油性ペン等でご記入ください。<br>●使用期間は約1カ月です。<br>(使用環境により異なります)●設置場所：食器棚に、引出しに、シンク下に ご注意<br>●定められた<br><br>使用方法<br>をお守りください。<br>●用途以外には使用しないでください。<br>●ご使用の際は、中身のシートに直接触れないようご注意ください。<br>●殺虫成分を含んでいませんが、誤って食べたりしないように、小児やペットの届かないところでご使用ください。<br>●皮膚についた時は石けんを用いてよく洗い流し、万一異常がある場合は医師にご相談ください。<br>●火気の近くや直射日光、高温を避け、涼しいところに保管してください。<br>●自治体の指導に従って捨ててください。<br> 用途室内用 成分精油成分(p-メンタン-3.8-ジオール)、茶乾留液 適用害虫キッチン廻りにいるイヤな「はう虫」(チャタテムシ、コクゾウムシ、シバンムシ、カツオブシムシ、ガ、クロアリ、アカアリ) <br>日用品／虫よけ・殺虫剤・忌避／虫除け(虫よけ)／虫よけ芳香剤<br>JANコード： 4987115541924<br><br>CS：40<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
