金鳥 線香立て 3枚入<br>ブランド：金鳥(KINCHO)<br>販売・製造元：大日本除虫菊<br><br>切断面を丸めに加工し、しっかりと蚊取り線香を支える設計の蚊取り線香器です。<br>広い場所・同時に色々な場所での蚊取り線香の利用時に便利です。<br> <br><br><br>使用方法<br>【線香立てのセットのしかた】「金鳥」の文字が正しく見える方を上にして線香立ての爪の中ほどを引き上げてください。<br>【線香渦巻きの立て方】線香を水平にさしこんでください。<br> <br><br>使用上の注意<br>●本品はレギュラーサイズ及びミニサイズの「線香」(別売)専用です。<br>※大型長時間タイプの「線香」には、金鳥大型吊り下げ式かとり線香皿(別売)をご使用ください。<br>※「線香」の<br><br>使用方法<br>、<br><br>使用上の注意<br>も必ずお読みください。<br>●陶器や金属の容器の上に置いて使用し、紙箱やプラスチック製の容器など、燃える危険性のあるものは使用しないでください。<br>●先端部分や金属のうすい所で手などを切らないよう十分ご注意ください。<br> <br><br>お問い合わせ先<br>大日本除虫菊株式会社TEL：06-6441-1105受付時間 9：00-17：00(土・日・祝日を除く) <br>日用品／虫よけ・殺虫剤・忌避／蚊取り用品／蚊取り線香皿・蚊取り線香器<br>JANコード： 4987115543171<br><br>CS：80<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
