日本女性の手から生まれたどのような持ち方でも安心して使えるソフトグリップと、刃が最適な角度で肌に接するインテリジェントフィッティングシステム、保水力に優れ従来品より潤滑機能が持続する新スムーサーを採用した、肌にやさしい５枚刃使い捨てカミソリ。<br><br><br>アクアフィット 2+1本入<br>ヘッドが自由自在に動き、お肌にやさしくフィットする女性用シェーバー(カミソリ)です。やさしい肌あたりの5枚刃。スムーザー付きで剃り味なめらかです。 <br>ご注意：●むだ毛そり用カミソリです。その目的以外に使用しないでください。<br>●お肌に合わない時は、ご使用を中止ください。<br>●刃先を拭かないでください。肌を痛めるおそれがあります。<br>●そる部分にクリーム、またはよく泡立てた石けんなどをつけて使用してください。カミソリを持つ手がすべらないように注意してください。<br>●使用後はよくすすぎ、水気をきってから、キャップをして乾燥した所に保管してください。<br>●70度以上の熱湯に入れないでください。変形することがあります。<br>●未使用のカミソリは乾燥した所に保管してください。湿度の高い場所では、スムーザーが溶け出す場合があります。スムーザーは溶けて色が変わります。品質に変化はありません。<br>●お子様の手の届かない所に保管してください。 品質表示【刃部】●ステンレス刃物鋼/長さ33 mm●チタンコーティング刃先処理●スムーザー：水溶性樹脂、吸水性樹脂【樹脂部】●ABS、エラストマー：耐熱温度70度●キャップ：PP <br>原産国：日本<br><br> お問い合わせ先：貝印株式会社 お客様相談室電話：03-3862-6410受付時間：9：00-12：00、13：00-17：00(土・日・祝日を除く)  <br>販売_製造元： 貝印<br>ブランド：<br>JAN：4901331017124<br>CS：100<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
