金鳥の渦巻 森の香り 10巻入<br>ブランド：金鳥の渦巻<br>販売・製造元：大日本除虫菊<br><br>安全性に配慮したピレスロイド系殺虫成分の蚊取り線香です。<br>やすらぐ森の香りが漂い、やさしい使い心地で煙刺激を低減します(メーカー比)。<br>自然なもえぎ色で、落ち着いた色合いです。<br>安定した殺虫効果を発揮し、約7時間有効です。<br>スチール製線香立て1個入り。<br>医薬部外品。<br> <br><br><br>使用方法<br>※渦巻はかならず1巻ずつはずしてから点火し、ご使用ください。<br>●線香立てのセットのしかた：「金鳥」の文字が正しく見える方を上にして線香立ての爪の中ほどを引き上げてください。<br>●線香渦巻のはずし方：線香渦巻の中心を軽く上下に押して外し、中心を上下からつまみ、まっすぐ引いて2巻に離してください。<br>●線香渦巻の火のつけ方：渦巻1巻の先端(1ヵ所)を下向きにして点火し、点火後は炎を消して徐々に燻焼させてください。<br>●線香渦巻の立て方：線香を水平にしてさしこんでください。<br> <br><br>使用上の注意<br>【相談すること】●万一、身体に異常を感じたときは使用を中止し、また小児などが誤って食べた場合は、すぐ吐き出させ、直ちに本剤がピレスロイド系の殺虫剤であることを医師に告げて診療を受けてください。<br>【その他の注意】●換気の良い場所で風上に置いてご使用ください。<br>しめ切った部屋で長時間使用すると、目、鼻、のどなどに刺激を感じることがあります。<br>●備え付けの線香立てあるいは専用燃焼具以外での使用はしないでください。<br>●使用中の線香は燃えやすいもののそばに置かないよう、あるいは、ふとんや衣類などがかぶらないよう十分ご注意ください。<br>また、線香が倒れないようご注意ください。<br>●線香立ては陶器や金属製の容器の上に置いて使用し、紙箱やプラスチック製の容器など、燃える危険性のあるものは使用しないでください。<br>●線香立ての先端部分や金属のうすい所で手などを切らないよう十分ご注意ください。<br>●受け皿にたまった灰は、使用後灰が冷えてから、その都度捨ててください。<br>【保管及び取扱上の注意】●直射日光を避け、湿気の少ない涼しい場所で小児の手の届かない所に保管してください。<br>【廃棄上の注意】●ご使用後は自治体の指導に従って捨ててください。<br> お願い●線香の上部を覆った燃焼具(金鳥香30巻缶の燃焼皿や市販の蚊遣りブタ等)を使われる場合は、燃焼具上部のウラ側に「ヤニ」が付着し、その落下によって線香の火が消えたり逆に燃え上がる恐れがあります。<br>10巻位を目安に必ずヤニの掃除(中性洗剤をつけてスポンジ、ブラシ等でこする)を行ってください。<br>●ご使用の線香近くの天井や壁、家具やカーテン等にヤニが付着し着色することがありますのでそれらのものから離して設置してください。<br>●観賞魚のいる部屋では近くで使用せず、部屋の換気をよくしてください。<br>●飼育昆虫のいる部屋では使用しないでください。<br> 品質表示●効能：蚊成虫の駆除●有効成分：ピレスロイド(dl・d-T80-アレスリン)・・・0.27w/w%●その他の成分：植物性微粉末、澱粉、デヒドロ酢酸Na、着色料、香料、他4成分 <br><br>お問い合わせ先<br>大日本除虫菊株式会社 お客様相談室TEL：06-6441-1105受付時間：9：00-17：00(土・日・祝日を除く) <br>日用品／虫よけ・殺虫剤・忌避／蚊取り用品／蚊取り線香<br>JANコード： 4987115000803<br><br>CS：60<br>区分：防除用医薬部外品<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
