ソフティモ 薬用ホワイト毛穴クリア スクラブイン 150g<br>ブランド：ソフティモ<br>販売・製造元：コーセーコスメポート<br><br>なめらかなビーズ入りの泡で、肌の透明感をアップする洗顔フォームです。<br>表面が波形の不定形ビーズが、肌に負担をかけずに残存メラニンや毛穴の奥の皮脂汚れ、くすみの原因となる古い角質まで的確に取り去り、つるつる素肌に洗い上げます。<br>豊かな泡立ちで、ニキビや肌荒れも防ぎます。<br>医薬部外品。<br> <br><br><br>使用方法<br>手のひらに適量(約2cm)をとり、水かぬるま湯でよく泡立ててから洗顔し、そのあと充分にすすいでください。<br> <br><br>使用上の注意<br>目に入らないようご注意ください。<br>万が一目に入った時は、こすらずに、すぐに水かぬるま湯で洗い流してください。<br>なお、すすいでも目に異物感が残る場合は、眼科医にご相談下さい。<br>日焼け後は、肌の赤みやひりつきがおさまってからお使い下さい。<br>ご使用語は、キャップをきちんとしめてください。<br> ご注意<br>傷やはれもの・湿しん等、お肌に異常のあるときはお使いにならないでください。<br>使用中、赤味・はれ・かゆみ・刺激等の異常があらわれた場合は、使用を中止し、皮ふ科専門医等へご相談ください。<br>そのまま使用を続けますと症状が悪化することがあります。<br>目に入ったときは、すぐに洗い流してください。<br>乳幼児の手の届かないところに保管してください。<br> <br>成分<br>有効成分：グリチルリチン酸ジカリウムその他の成分；精製水、ミリスチン酸、濃グリセリン、ステアリン酸、水酸化カリウム、ラウリン酸、高融点ポリエチレン末、ポリエチレングリコールポリエチレグリコール1500、ポリエチレングリコール300、ポリオキシエチレンラウリルエーテル(7.5E.O)、パール末、ヨクイニンエキス、リンゴエキス、1.3-ブチレングリコール、N-ヤシ油脂肪酸アシルグリシンカリウム液、ジステアリン酸エチレングリコール、ミリストイルメチルタウリンナトリウム、、親油型モノステアリン酸グリセリル、無水エタノール <br>クレンジング・洗顔／洗顔／洗顔フォーム<br>JANコード： 4971710305944<br><br>CS：48<br>区分：医薬部外品<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
